import React, { Component } from "react";
import { Link } from "react-router-dom";
import * as moment from "moment";

import { fetchUserBookings, getPendingPayments } from "../../actions";

import { connect } from "react-redux";

class BookingManage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      pendingPayments: []
    };
  }

  componentDidMount() {
    this.props.fetchUserBookings();
    this.getPendingPayments();
  }

  getPendingPayments() {
    this.props
      .getPendingPayments()
      .then(pendingPayments => this.setState({ pendingPayments }))
      .catch(error => console.log(error));
  }
  render() {
    const { isAuthenticated } = this.props.auth;
    const { bookings, isFetching } = this.props;

    return (
      <div>
        {isAuthenticated && (
          <section id="userBookings">
            <h1 className="page-title">My Bookings</h1>
            <div className="row">
              {bookings.map(booking => (
                <div className="col-md-4">
                  <div className="card text-center">
                    <div className="card-header">{booking.rental.category}</div>
                    <div className="card-block">
                      <h4 className="card-title">
                        {" "}
                        {booking.rental.title} - {booking.rental.city}
                      </h4>
                      <p className="card-text booking-desc">
                        {booking.rental.description}
                      </p>
                      <p className="card-text booking-days">
                        {moment(booking.startAt).format(" MM/DD/YYYY")} -{" "}
                        {moment(booking.endAt).format("MM/DD/YYYY")} |{" "}
                        {booking.days} days
                      </p>
                      <p className="card-text booking-price">
                        <span>Price: </span>{" "}
                        <span className="booking-price-value">
                          {booking.totalPrice} $
                        </span>
                      </p>
                      {booking.rental && (
                        <Link
                          className="btn"
                          to={`/rentals/${booking.rental._id}`}
                        >
                          Go to Rental
                        </Link>
                      )}
                    </div>
                    <div className="card-footer text-muted">
                      Created {moment(booking.createdAt).format("MM/DD/YYYY")}
                    </div>
                  </div>
                </div>
              ))}
            </div>
            {!isFetching && bookings.length === 0 && (
              <div class="alert alert-warning">
                You have no bookings created go to rentals section and book your
                place today.
                <Link
                  style={{ "margin-left": "10px" }}
                  class="btn"
                  to="/rentals"
                >
                  Available Rental
                </Link>
              </div>
            )}
          </section>
        )}
        <section id="pendingBookings">
          <h1 className="page-title">My Pending Bookings</h1>
          <div className="row">
            {payments.map((payment, booking) => (
              <div className="col-md-4">
                <div className="card text-center">
                  <div className="card-header">
                    Booking made by: {payment.fromUser.username}
                  </div>
                  <div className="card-block">
                    <h4 className="card-title">
                      {" "}
                      {booking.rental.title} - {booking.rental.city}
                    </h4>
                    <p className="card-text booking-desc">
                      {booking.rental.description}
                    </p>
                    <p className="card-text booking-days">
                      {moment(booking.startAt).format(" MM/DD/YYYY")} -{" "}
                      {moment(booking.endAt).format("MM/DD/YYYY")} |{" "}
                      {booking.days} days
                    </p>
                    <p className="card-text booking-price">
                      <span>Price: </span>{" "}
                      <span className="booking-price-value">
                        {payment.amount / 100} $
                      </span>
                    </p>
                    {booking.rental && (
                      <Link
                        className="btn"
                        to={`/rentals/${booking.rental._id}`}
                      >
                        Go to Rental
                      </Link>
                    )}
                  </div>
                  <div className="card-footer text-muted">
                    Created {moment(booking.createdAt).format("MM/DD/YYYY")}
                  </div>
                </div>
              </div>
            ))}
          </div>
          {!isFetching && bookings.length === 0 && (
            <div class="alert alert-warning">
              You have no bookings created go to rentals section and book your
              place today.
              <Link style={{ "margin-left": "10px" }} class="btn" to="/rentals">
                Available Rental
              </Link>
            </div>
          )}
        </section>
      </div>
    );
  }
}

const mapStateToProps = state => ({
  auth: state.auth,
  bookings: state.bookings.bookings,
  errors: state.errors
});

export default connect(mapStateToProps, { fetchUserBookings })(BookingManage);
